import { useState, useEffect } from "react";
import { supabase } from "../supabaseClient";
import Navbar from "./navbar";

export default function NewShift({ userID }) {
  const [jobs, setJobs] = useState([]);
  const [jobId, setJobId] = useState('');  
  const [hoursWorked, setHoursWorked] = useState(0);
  const [tips, setTips] = useState(0);
  const [date, setDate] = useState('');

  useEffect(() => {
    const getJobsList = async () => {
      let { data, error } = await supabase
      .from('job')
      .select('id, name, hourlyRate')
      .eq('userFK', userID)
      if (error) console.log(error)
      else setJobs(data);
    }

    getJobsList();
  });

  const insertShift = async () => {
    for (let i = 0; i < jobs.length; i++) {

      if (jobs[i].id === jobId) {

        const { data, error } = await supabase
        .from('shift')
        .insert(
          { hoursWorked: hoursWorked, tips: tips, total: tips + (hoursWorked * jobs[i].hourlyRate), date: date, jobFK: jobId },
        )
        if (error) console.log(error)
        else console.log(data)

      }

    }
  };

  return (
    <div>
      <Navbar />
      <div className="container p-4 my-4 border">
        <div className="border-bottom">
          <p className="h4">Create a new shift</p>
        </div>

        <div className="my-3">
          <span class="h6">Tips</span>
          <input type="number" class="form-control" placeholder="Add tips" onChange={(e) => setTips(Number(e.target.value))} />
        </div>

        <div className="my-3">
          <span class="h6">Hours worked</span>
          <input type="number" class="form-control" placeholder="Hours worked" onChange={(e) => setHoursWorked(Number(e.target.value))} />
        </div>

        <div className="my-3">
          <span class="h6">Date</span>
          <input type="text" class="form-control" placeholder="year-month-date" onChange={(e) => setDate(e.target.value)} />
        </div>      

        <div>
          <label>Choose job:</label>
          <select onChange={(e) => setJobId(e.target.value)}>
            <option disabled>Please select</option>
            {jobs.map(job => <option key={job.id} value={job.id}>{job.name}</option>)}
          </select>
        </div>

        <button type="button" class="btn btn-success" onClick={insertShift}>Submit</button>
      </div>
    </div>
    );
};
